import React from 'react';

const ResultsButtons = ({ onClick }) => {
  const resultTypes = [
    'Disease',
    'Description',
    'Precaution',
    'Medications',
    'Workouts',
    'Diets',
  ];

  return (
    <div style={{ display: 'flex', gap: '10px', marginTop: '20px' }}>
      {resultTypes.map((type) => (
        <button key={type} onClick={() => onClick(type)}>
          {type}
        </button>
      ))}
    </div>
  );
};

export default ResultsButtons;
